import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <div className="row justify-content-end">
                <div className="col-xl-3" style={logoStyle}>
                    <a href="#" style={logoImgStyle}><img src={logoimg} alt='Visit Creator`s site' /></a>
                </div>
            </div>
        )
    }
}
const logoStyle = {
    backgroundColor: 'rgba(51, 51, 51, 0.9)',
    borderRadius: '20px',
    padding: '4px',
    paddingTop: '7px',
}
const logoImgStyle = {
    wigth: '100%'
}
export default Logo
